import React from 'react';
import './style.css';

function Card() {
  return (
    <div className='card'>
        <div className="card-img">
            <img src="https://png.pngtree.com/element_our/20190604/ourmid/pngtree-user-avatar-boy-image_1482937.jpg" alt="user" />
        </div>
        <div className="card-body">

        </div>
    </div>
  )
}

export default Card
